INSERT INTO `app_game` VALUES ('1783', '发泄一下', '一款有趣的游戏插件，使用各种武器击倒发泄对象即可，并获得一定的现金券', '<p>一款有趣的游戏插件，使用各种武器击倒发泄对象即可，并获得一定的现金券</p>', '<p>该活动已下线，暂无奖品。</p>', 'http://res1.i-lz.cn/mmopen/1.png', 'http://plugin.i-lz.cn/jz9D9nGsHkgZNUB2', '0', null, '0', null, null, '1', '0', '0', '2808', '100', '0', '0', '0', '0', '23', '7', '0', '0.00', '0.00', '2016-08-23', '2016-09-22', '2016-06-15 11:50:57', '2016-09-19 07:44:40', '1', '1100', '0', '10', '1', '200');
INSERT INTO `app_game` VALUES ('1784', '滚铁环', '向左，向右倾斜手机以控制铁环的平衡度位', '<div>核心功能</div><p>向左，向右倾斜手机以控制铁环的平衡度位于“最佳位置”内，使铁环快速向前滚动，60秒内滚完400米则完成挑战并获得奖品。</p><p><br/></p>', '<p>该活动已下线，暂无奖品。</p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/57750608da4d7.jpg', 'http://plugin.i-lz.cn/j36M7ji2AarXqCZh', '0', null, '0', null, null, '1', '0', '0', '12691', '100', '0', '0', '0', '0', '22', '7', '0', '0.00', '0.00', '2016-08-23', '2018-09-08', '2016-06-30 19:42:27', '2017-10-26 16:07:43', '3', '145', '0', '10', '10', '300');
INSERT INTO `app_game` VALUES ('1786', '拆散专家', '由下往上手指疯狂点击游戏人物一对双数，点到单数人物游戏结束', '<p style=\"white-space: normal;\">游戏玩法：</p><p style=\"white-space: normal;\">1：由下往上手指疯狂点击游戏人物一对双数，点到单数人物游戏结束，30秒内点的游戏人物一对数量取最佳计入排行榜。<br/>2：每天5次游戏机会，可分享好友加油助力，获得额外一次游戏机会<br/>3：参与活动者需关注公众号填写个人信息，以便活动后我们的工作人员跟你联系<br/>4：按游戏的排行顺序依次获得富力广场提供的相关礼品。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p><br/></p>', '<p>活动时间：<br style=\"white-space: normal;\"/>2016年7月9日至2016年8月8日<br style=\"white-space: normal;\"/>游戏奖项设置：<br style=\"white-space: normal;\"/>排名第1-5名参与者：富力广场提供价值千元品牌手部按摩仪一台<br style=\"white-space: normal;\"/>排名第6-10名参与者：富力广场提供价值三百元品牌保温杯一个<br style=\"white-space: normal;\"/>排名第11-30名参与者：富力广场提供精美品牌精油皂礼盒一个<br style=\"white-space: normal;\"/>领取方式：<br style=\"white-space: normal;\"/>领奖日期：2016年8月10日至2016年8月22日，凭登陆游戏姓名及联系方式至富力广场一层服务台领取。</p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/57886414e2b90.jpg', 'http://plugin.i-lz.cn/VX49sDEU6WwihbzC', '0', null, '0', null, null, '1', '0', '0', '52', '10', '0', '0', '0', '0', '3', '3', '0', '0.00', '0.00', '2016-08-23', '2016-09-30', '2016-07-15 11:26:26', '2016-09-27 21:43:28', '10', '40', '0', '10', '10', '300');
INSERT INTO `app_game` VALUES ('1787', '限时助力	', '选择一款心仪的礼品，邀请好友为你攒人气', '<p style=\"white-space: normal;\">活动时间：2016/7/15-2016/7/31</p><p style=\"white-space: normal;\">参与方式：</p><p style=\"white-space: normal;\">1.活动期间发起者选择一款心仪的礼品，放入购物车并分享到朋友圈召唤小伙伴们为你攒人气；</p><p style=\"white-space: normal;\">2.每个人限30分钟召唤个小伙伴为自己点赞，从点击【确认】键后系统开始自动计算；</p><p style=\"white-space: normal;\">3.若在规定时间内筹集到足够小伙伴为你点赞，即为成功，点击领取按钮，输入真实的姓名、联系电话；</p><p style=\"white-space: normal;\">4.若在规定时间内无法筹集到足够人气数量或系统显示礼品已送完，则属失败，失败后可以重新选取其他礼品进行游戏；</p><p style=\"white-space: normal;\">5.活动时间内，一个微信号只能成功完成一次集赞活动，但能帮多人打气。</p><p style=\"white-space: normal;\">6、所有礼品均在天河城店五楼客服中心领取。请注意！</p><p><br/></p>', '<p style=\"white-space: normal;\">奖品兑换：</p><p style=\"white-space: normal;\">1.礼品数量有限，每款礼品限量，先到先得，全部礼品兑完，活动即止；</p><p style=\"white-space: normal;\">2.活动结束后将在7-15个工作日核对照成功的个人信息和联系电话并发送领奖短信，请留意电话；，</p><p style=\"white-space: normal;\">3.请在游戏结束前登记信息，过期等同放弃礼品。</p><p style=\"white-space: normal; text-align: center;\"><br/></p><p><br/></p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/5788938303491.jpg', 'http://plugin.i-lz.cn/IVXZPFNZzPuKi8QE', '0', null, '0', null, null, '1', '0', '0', '100', '15', '0', '0', '0', '0', '5', '2', '0', '0.00', '0.00', '2016-08-23', '2016-10-28', '2016-07-15 15:05:06', '2016-10-27 15:59:50', '7', '50', '0', '10', '10', '300');
INSERT INTO `app_game` VALUES ('1788', '愤怒的小红帽	', '点击瞄准圈射击怪兽，射的越多，分数越高，零时结束。', '<p style=\"white-space: normal;\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">活动时间：</span></strong><span style=\"font-family: 微软雅黑, sans-serif;\">2016</span><span style=\"font-family: 微软雅黑, sans-serif;\">年7月15-24日</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">游戏玩法：</span></strong></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, sans-serif;\">1.</span><span style=\"font-family: 微软雅黑, sans-serif;\">用户点击瞄准圈射击怪兽，射得越多，分数越高。错过怪兽，小熊将受到攻击，血量减少。血量为零时，活动结束。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, sans-serif;\">2.</span><span style=\"font-family: 微软雅黑, sans-serif;\">用户每天2次游戏机会，可邀请好友一起来玩，每邀请一人可以获得额外多玩一次机会。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, sans-serif;\">3.</span><span style=\"font-family: 微软雅黑, sans-serif;\">排行榜记用户单次最高得分。</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, sans-serif;\">4.</span><span style=\"font-family: 微软雅黑, sans-serif;\">活动结束后按排行榜上排名发放礼品。</span></p><p><br/></p>', '<p style=\"white-space: normal;\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">&nbsp;</span></strong><strong><span style=\"font-family: 微软雅黑, sans-serif;\">奖品设置：</span></strong></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, sans-serif;\">（1-3名）每人获得200元购物券一张</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 微软雅黑, sans-serif;\">领奖方式：</span></strong><span style=\"font-family: 微软雅黑, sans-serif;\"><br/></span><span style=\"font-family: 微软雅黑, sans-serif;\">活动结束后，根据排行榜排名，我司将向获奖顾客发送短信，根据短信提示，在规定时间内凭短信至天河城百货南海店客服中心领奖。</span></p><p><br/></p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/578894976be75.jpg', 'http://plugin.i-lz.cn/8u6i2aSJSxiWUc5V', '0', null, '0', null, null, '1', '0', '0', '112', '10', '0', '0', '0', '0', '14', '6', '0', '0.00', '0.00', '2016-08-23', '2016-11-02', '2016-07-15 15:10:32', '2016-11-01 23:52:50', '12', '100', '0', '10', '10', '300');
INSERT INTO `app_game` VALUES ('1789', '马戏团', '点击屏幕获得金币，躲避障碍物，碰到障碍物游戏结束', '<p style=\"white-space: normal;\">活动时间：2016/7/13-2016/7/31</p><p style=\"white-space: normal;\">参与方式：</p><p style=\"white-space: normal;\">游戏开始后，用户需通过点击屏幕获得金币、躲避障碍物。碰到障碍物游戏结束，按当次游戏获得的金币计分。每个用户每天有5次游戏机会，5次机会用完后可转发该游戏至好友、微信群以及分享到朋友圈邀请好友助力，好友参与游戏后即可获多1次游戏机会。好友助力次数不限。</p><p><br/></p>', '<p style=\"white-space: normal;\">游戏奖励：</p><p style=\"white-space: normal;\">活动截止日期2016.7.31！活动结束后，排行榜前21名的用户进入活动时，就会直接弹出中奖页面。复制F码后，进入兑换页面，然后再填写收货地址和联系方式。奖品将会在3-5个工作日寄到您的手中。<br/>注：收货地址仅限深圳地区有效，其它地区我们将有权取消中奖资格！</p><p style=\"white-space: normal;\">奖品设置：</p><p style=\"white-space: normal;\">1名：CLARA 原汁机超值组</p><p style=\"white-space: normal;\">2-6名：AGRIC阿格利司特级初榨橄榄油1L</p><p style=\"white-space: normal;\">7-21名：营销奖品 线控自拍杆</p><p><br/></p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/578894cd4b827.jpg', 'http://plugin.i-lz.cn/egBrtDHEgtivu7mF', '0', null, '0', null, null, '1', '0', '0', '64', '10', '0', '0', '0', '0', '109', '12', '0', '0.00', '0.00', '2016-08-23', '2016-08-23', '2016-07-15 15:28:44', '2016-08-23 17:12:56', '9', '340', '0', '10', '10', '300');
INSERT INTO `app_game` VALUES ('1790', '中秋节H5互动方案', '分享好友获得积分，相应积分可以提取现金噢！', '<p>中秋马上就要到啦！<br/>大家是不是买了好多好多月饼呢<br/>别忘了，咱们联众互动<br/>也是相当的应景，推出了几款中秋插件<br/>各位在美美的吃月饼的同时候，<br/>别忘了咱们的哦！<br/></p>', '<p>奖品名称：<br/>&nbsp;首次分享获得100积分，分享好友点击获得10分，共10次机会<br/>&nbsp;奖品说明：100积分=1元现金（积分有限，先到先得）&nbsp;<br/></p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/57bac9c044103.jpg', 'https://mp.weixin.qq.com/s?__biz=MzA4MTM1NjAyMw==&mid=2655113995&idx=1&sn=3f8ca857521a2778e207ddedf1f33c6c&scene=1&srcid=08221egz5Pal4yLPaTWbc9YN&key=', '0', null, '0', null, null, '1', '0', '0', '216', '127', '0', '0', '0', '0', '235', '39', '0', '0.00', '0.00', '2016-08-22', '2016-09-30', '2016-08-22 16:40:39', '2017-05-16 17:28:04', '13', '20000', '18640', '100', '10', '200');
INSERT INTO `app_game` VALUES ('1791', '梦想季博头彩', '分享好友获得积分，相应积分可以提取现金噢！', '<p style=\"text-align: center;\"><span style=\"font-family: 宋体; font-size: 20px;\">抢红包太累 送红包才对！</span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体; font-size: 20px;\">润柏香港城“梦想季 博头彩”</span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体; font-size: 20px;\">不需要等到过年</span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体; font-size: 20px;\">现在就让你们拿红包</span></p><p style=\"text-align: center;\"><span style=\"font-size: 20px;\"><span style=\"font-size: 20px; font-family: 宋体;\">抢红包早就</span><span style=\"font-family: 宋体; font-size: 14px;\">OUT<span style=\"font-size: 20px; font-family: 宋体;\">了</span></span></span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体; font-size: 20px;\">润柏香港城直接送给你</span></p><p style=\"text-align: center;\"><span style=\"font-family: 宋体; font-size: 20px;\">人人都有份 只怕你参加！</span></p><p><br/></p>', '<p><span style=\"font-family: 宋体; font-size: 20px;\">游戏规则：</span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">首次分享获得100积分，好友点击获得<span style=\"font-size: 20px; font-family: Calibri;\">10</span>积分，最高上限<span style=\"font-size: 20px; font-family: Calibri;\">10000</span>积分。</span></p><p><span style=\"font-family: 宋体; font-size: 20px;\">100积分<span style=\"font-size: 20px; font-family: Calibri;\">=1</span>元钱</span></p><p><br/></p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/57c7eef181837.jpg', 'http://mp.weixin.qq.com/s?__biz=MzAwNTY3MTk4Mw==&tempkey=oaoRlId%2B4kxd2B9aiWpf6i6AxPOISIoH8YdwK7weoz384Md%2BqTIYqjPiH1IQr6%2B%2FXUYNHQpwBrwybBzeW1KmU', '0', null, '0', null, null, '1', '0', '0', '45', '0', '0', '0', '0', '0', '14', '5', '0', '0.00', '0.00', '2016-09-01', '2016-09-22', '2016-09-01 15:42:50', '2016-11-03 15:43:44', '14', '0', '0', '0', '0', '0');
INSERT INTO `app_game` VALUES ('1792', '让世界爱上深圳造', '注册分享好友获得积分，相应积分可以提取现金噢！', '<p>宜和购物11月9日，乐购深圳之《向深圳产品致敬》晚会，最佳网络人气品牌由你来决定，投票参与即有机会获取精美礼品。</p>', '<p>奖品名称：</p><p>&nbsp;首次分享获得50积分，分享好友点击获得10分<br/>&nbsp;奖品说明：100积分=1元现金（积分有限，先到先得）</p><p><br/></p>', 'http://share.i-lz.cn/uploads/Z2hfNDhiMzI0NmE3YmI3/temp/581adc8e6d692.png', 'http://plugin.i-lz.cn/fSaHTgzEXyk8thH3/game/index', '0', null, '0', null, null, '1', '0', '0', '287', '127', '0', '0', '0', '0', '206', '30', '0', '0.00', '0.00', '2016-11-03', '2018-11-23', '2016-11-03 14:54:32', '2017-10-25 20:26:21', '15', '150000', '148940', '50', '10', '200');
