INSERT INTO `sys_setup` VALUES ('8', '网站简介', 'seo_description', '深圳市回家科技有限公司（简称“微管家”）,定位于物业服务机构，致力于为物业/业主/住户提供值得信赖的物管助手。 “微管家”充分运用移动互联网技术，通过线上服务平台，并结合线下服务网络等打造了全面覆盖物业的单个或连锁运营系统，创建出全新的O2O（线上线下相结合）社区服务模式，为物业/业主/住户提供多元化产品与服务。传承“微管家”值得信赖的承诺，让物业/业主/住户足不出户即可享受到便捷舒适的服务体验。居家需求和意见都可通过“微管家”社区服务的线上功能得到解决。力争成为物业管理公司的服务最佳拍档。', '1', '0', '0');
