-- ----------------------------
-- Table structure for app_game
-- ----------------------------
DROP TABLE IF EXISTS `app_game`;
CREATE TABLE `app_game` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL COMMENT '名字',
  `note` varchar(255) DEFAULT NULL COMMENT '活动简介',
  `desc` text COMMENT '活动说明',
  `desc1` text COMMENT '奖品说明',
  `icon` varchar(200) DEFAULT NULL COMMENT '图标',
  `url` varchar(150) DEFAULT NULL COMMENT '游戏链接',
  `classify` tinyint(4) DEFAULT '0' COMMENT '分类 0默认1首发2推荐3热度4开服5精品其它待定',
  `classify_text` varchar(25) DEFAULT NULL COMMENT '分类描述',
  `area` int(11) DEFAULT '0' COMMENT '地区',
  `company` varchar(150) DEFAULT NULL COMMENT '主办单位',
  `prize_name` varchar(50) DEFAULT NULL COMMENT '奖品名称',
  `category` tinyint(4) DEFAULT '1' COMMENT '类别1互动游戏2商家游戏3竞赛游戏',
  `type` tinyint(4) DEFAULT '0' COMMENT '游戏类型',
  `posid` varchar(50) DEFAULT '0' COMMENT '推荐位',
  `clicks` int(11) DEFAULT '0' COMMENT '点击数',
  `promote` tinyint(6) DEFAULT '0' COMMENT '推荐值',
  `yesterday_clicks` int(11) DEFAULT '0' COMMENT '昨天点击数',
  `lmonth_clicks` int(11) DEFAULT '0' COMMENT '上个月点击数',
  `participation_num` int(11) DEFAULT '0' COMMENT '显示参与人数',
  `participation_num_t` int(11) DEFAULT '0' COMMENT '真实参与人数',
  `share_clicks` int(11) DEFAULT '0' COMMENT '活动点击率',
  `share_num` int(11) DEFAULT '0' COMMENT '转发数',
  `share_num_t` int(11) DEFAULT '0' COMMENT '真实分享人数',
  `share_proportion` double(11,2) DEFAULT '0.00' COMMENT '转发率',
  `share_proportion_t` double(11,2) DEFAULT '0.00' COMMENT '转发率',
  `start_tm` date NOT NULL COMMENT '上线时间',
  `stop_tm` date DEFAULT NULL COMMENT '下线时间，留空刚永久显示',
  `ctm` datetime NOT NULL,
  `utm` datetime NOT NULL,
  `unid` int(11) DEFAULT NULL COMMENT '所属商户',
  `integral_all` int(11) DEFAULT '0' COMMENT '总积分',
  `integral` int(11) DEFAULT '0' COMMENT '当前积分',
  `integral_self` int(11) DEFAULT '0' COMMENT '自己分享后可获得积分',
  `integral_share` int(11) DEFAULT '0' COMMENT '好友帮忙点击后获得积分',
  `integral_limit` int(11) DEFAULT '0' COMMENT '单个用户积分上限',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1794 DEFAULT CHARSET=utf8mb4 COMMENT='活动表';

-- ----------------------------
-- Records of app_game
-- ----------------------------

