  `pre` tinyint(2) NOT NULL DEFAULT '0' COMMENT '顶级配置',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=74 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sys_setup
-- ----------------------------

-- ----------------------------
-- Table structure for sys_shortmsg
-- ----------------------------
DROP TABLE IF EXISTS `sys_shortmsg`;
CREATE TABLE `sys_shortmsg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fromuserid` int(11) NOT NULL DEFAULT '0' COMMENT '来自发送者ID',
  `touserid` int(11) NOT NULL DEFAULT '0' COMMENT '接收者ID',
  `msg` varchar(200) NOT NULL COMMENT '短信内容',
  `issys` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否系统短信',
  `usertype` tinyint(1) NOT NULL DEFAULT '-1' COMMENT '消息所属会员组 -1全部',
  `addtime` int(8) NOT NULL DEFAULT '0' COMMENT '发送时间',
  PRIMARY KEY (`id`),
  KEY `fromuserid` (`fromuserid`) USING BTREE,
  KEY `touserid` (`touserid`) USING BTREE,
  KEY `issys` (`issys`) USING BTREE,
  KEY `usertype` (`usertype`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8;

