CREATE TABLE `sys_slide_img` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sid` smallint(6) NOT NULL COMMENT '幻灯片栏位对应slide表id',
  `pic` varchar(200) NOT NULL DEFAULT '' COMMENT '片图',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '题标',
  `url` varchar(200) NOT NULL DEFAULT '' COMMENT '接链',
  `note` varchar(255) NOT NULL DEFAULT '',
  `minpic` varchar(200) NOT NULL DEFAULT '',
  `listorder` int(11) NOT NULL DEFAULT '0',
