-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '用户名',
  `nickname` varchar(25) CHARACTER SET utf8 DEFAULT '' COMMENT '昵称，商户名称',
  `company` varchar(50) DEFAULT '' COMMENT '公司名称，企业名称',
  `password` varchar(128) CHARACTER SET utf8 DEFAULT '',
  `headimg` varchar(200) CHARACTER SET utf8 DEFAULT '' COMMENT '头像',
  `phone` varchar(12) CHARACTER SET utf8 DEFAULT '' COMMENT '手机号',
  `qq` varchar(15) CHARACTER SET utf8 DEFAULT '' COMMENT 'QQ',
  `email` varchar(50) CHARACTER SET utf8 DEFAULT '' COMMENT '邮箱',
  `last_login_time` int(11) unsigned DEFAULT '0' COMMENT '最后登录时间',
  `last_login_ip` varchar(40) CHARACTER SET utf8 DEFAULT '' COMMENT '最后登录Ip',
  `login_count` int(4) DEFAULT '0' COMMENT '登录次数',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `status` tinyint(1) NOT NULL DEFAULT '0',
  `groupid` int(2) NOT NULL DEFAULT '0' COMMENT '角色组',
  `ghid` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `account` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4;

-- ----------------------------
-- Records of sys_user
-- ----------------------------

-- ----------------------------
-- Table structure for sys_usergroup
-- ----------------------------
DROP TABLE IF EXISTS `sys_usergroup`;
CREATE TABLE `sys_usergroup` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `groupname` varchar(20) NOT NULL DEFAULT '',
  `listorder` int(1) NOT NULL DEFAULT '0',
  `flagarr` text COMMENT '组权限',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sys_usergroup
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user_gh
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_gh`;
CREATE TABLE `sys_user_gh` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `ghid` varchar(50) NOT NULL COMMENT '公众号ID（原始ID）',
  `name` varchar(50) NOT NULL COMMENT '公众号名称',
  `icon_url` varchar(200) DEFAULT NULL COMMENT '公众号图标',
  `qrcode` varchar(200) DEFAULT NULL COMMENT '二维码图片地址-大，可在大屏幕显示',
  `qrcode_small` varchar(200) DEFAULT NULL COMMENT '二维码图片-小，可在微信显示',
  `type` tinyint(4) DEFAULT '0' COMMENT '公众号类型，0普通订阅号，1认证订阅号，2普通服务号，3认证服务号',
  `wxh` varchar(50) DEFAULT NULL COMMENT '微信号',
  `company` varchar(100) NOT NULL COMMENT '公司名',
  `desc` varchar(200) DEFAULT NULL COMMENT '公众号介绍',
  `appid` varchar(50) DEFAULT NULL,
  `appsecret` varchar(50) DEFAULT NULL,
  `notes` varchar(50) DEFAULT NULL COMMENT '备注',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态。1正常可用，其他值为非正常状态。',
  `ctm` datetime DEFAULT NULL,
  `utm` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最近修改时间',
  `paySignKey` varchar(200) DEFAULT '' COMMENT '微信支付paySignKey的值',
  `partnerId` varchar(20) DEFAULT '' COMMENT '财付通商户号partnerId',
  `partnerKey` varchar(50) DEFAULT '' COMMENT '财付通商户密钥partnerKey',
  `mchId` varchar(32) DEFAULT '' COMMENT '微信支付分配的商户号',
  `tenant_id` int(11) DEFAULT '0' COMMENT '商户ID,即此账号拥有者',
  `oauth` tinyint(4) DEFAULT '1' COMMENT '微信授权方式。1精准分众传媒，2联众互动，100自己',
  `access_token` varchar(200) DEFAULT NULL COMMENT '公众号的全局唯一票据',
  `at_expires` datetime DEFAULT NULL COMMENT 'access_token的过期时间。',
  `jsapi_ticket` varchar(200) DEFAULT NULL COMMENT '分享ticket',
  `jsapi_ticket_expire` datetime DEFAULT NULL COMMENT '分享ticket到期时间',
  `jsapi` tinyint(4) DEFAULT '1' COMMENT '使用谁的appid来分享。1精准分众传媒，2联众互动，100自己。如果选择了100，请确保在客户微信公众号平台配置了JS接口安全域名，否则不能正常分享。',
  PRIMARY KEY (`id`),
  UNIQUE KEY `I_ghid` (`ghid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=669 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='公众号信息表';

-- ----------------------------
-- Records of sys_user_gh
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_menu`;
CREATE TABLE `sys_user_menu` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `modelname` varchar(30) NOT NULL DEFAULT '',
  `parameter` varchar(30) DEFAULT '' COMMENT '参数，形如 type=1&sid=2',
  `title` varchar(50) NOT NULL DEFAULT '',
  `icon` varchar(30) DEFAULT 'icon-laptop',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '是否启用',
  `isshow` tinyint(1) DEFAULT '1' COMMENT '是否显示',
  `listorder` int(2) NOT NULL DEFAULT '1',
  `pid` int(4) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=212 DEFAULT CHARSET=utf8 COMMENT='系统菜单';

-- ----------------------------
-- Records of sys_user_menu
-- ----------------------------

