-- ----------------------------
-- Table structure for sys_wxredpack_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_wxredpack_log`;
CREATE TABLE `sys_wxredpack_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '序号 自动递增',
  `wxappid` varchar(50) DEFAULT '' COMMENT '公众号appid',
  `mch_id` varchar(20) DEFAULT '' COMMENT '微信支付分配的商户号',
  `mch_billno` varchar(30) DEFAULT '' COMMENT '商户订单号',
  `re_openid` varchar(50) DEFAULT '' COMMENT '红包接收方的openid',
  `send_listid` varchar(50) DEFAULT '' COMMENT '发放的红包编号',
  `total_amount` int(11) DEFAULT '0' COMMENT '红包金额，单位为分',
  `err_code` varchar(20) DEFAULT NULL COMMENT '返回的错误码',
  `err_code_des` varchar(100) DEFAULT '' COMMENT '返回的错误描述信息',
  `return_code` varchar(10) DEFAULT '' COMMENT '返回的错误代码',
  `return_msg` varchar(50) DEFAULT '' COMMENT '返回提示信息',
  `result_code` varchar(10) DEFAULT '' COMMENT '返回结果状态码',
  `send_time` varchar(20) DEFAULT '' COMMENT '红包发送时间',
  `ctm` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='红包日志';

-- ----------------------------
-- Records of sys_wxredpack_log
-- ----------------------------

-- ----------------------------
-- Table structure for sys_wxredpack_record
-- ----------------------------
DROP TABLE IF EXISTS `sys_wxredpack_record`;
CREATE TABLE `sys_wxredpack_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '动活id',
  `appid` varchar(50) DEFAULT '' COMMENT '商户appid',
  `mchid` varchar(15) DEFAULT '' COMMENT '微信支付分配的商户号',
  `billno` varchar(30) DEFAULT '' COMMENT '户商订单号',
  `proveName` varchar(50) DEFAULT '' COMMENT '包红提供方名称',
  `sendName` varchar(50) DEFAULT '' COMMENT '红包发送方的名称',
  `re_openid` varchar(50) DEFAULT '' COMMENT '接收红包用户的openid',
  `money` int(11) DEFAULT '0' COMMENT '发放红包的金额，单位为分',
  `wishing_words` varchar(150) DEFAULT '' COMMENT '红包祝福语',
  `ext_info` varchar(50) DEFAULT '' COMMENT '红包发送者的openid',
  `statue` tinyint(4) DEFAULT '0' COMMENT '红包发送状态：0-未成功  1-已成功',
  `msg` varchar(100) CHARACTER SET utf8 COLLATE utf8_icelandic_ci DEFAULT '' COMMENT '红包发放的返回信息',
  `ip` varchar(20) DEFAULT '' COMMENT '用户IP',
  `ua` varchar(250) DEFAULT '' COMMENT '用户浏览器信息',
  `ctm` datetime DEFAULT NULL COMMENT '创建时间',
  `utm` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '刷新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='红包记录';

